import React, { useState, useEffect } from 'react';

const Power = () => {
    const [showMore, setShowMore] = useState(false);
    const [currentLoad, setCurrentLoad] = useState(0);
    const [capacity, setCapacity] = useState(0);
    const [motorData, setMotorData] = useState({ frLoad: 12.5, flLoad: 12.7, brLoad: 12.6, blLoad: 12.5 });
    const [jointData, setJointData] = useState({ j0Load: 2, j1Load: 1.5, j2Load: 1.2, j3Load: 1.3, j4Load: 1.3, eeLoad: 6 });
    const [labLoadData, setLabLoadData] = useState({ x: 2.2, y: 2.0, z: 1.8, tray: 4.3, gripper: 1 });

    const toggleMenu = () => {
        setShowMore(!showMore);
    };

    useEffect(() => {
      const interval = setInterval(() => {
          // Function to generate random value in the range [-0.4, 0.4] with step 0.1
          const getRandomValue = () => (Math.round((Math.random() * 0.8 - 0.4) / 0.1) * 0.1).toFixed(1);


          setCurrentLoad(parseFloat(motorData.frLoad) + parseFloat(motorData.flLoad) + parseFloat(motorData.brLoad) + parseFloat(motorData.blLoad) +
          parseFloat(jointData.j0Load) + parseFloat(jointData.j1Load) + parseFloat(jointData.j2Load) + parseFloat(jointData.j3Load) + parseFloat(jointData.j4Load) + parseFloat(jointData.eeLoad) +
          parseFloat(labLoadData.x) + parseFloat(labLoadData.y) + parseFloat(labLoadData.z) + parseFloat(labLoadData.tray) + parseFloat(labLoadData.gripper));

          setMotorData(prevMotorData => {
              const frLoadCalc = Math.min(12.9, Math.max(12.1, parseFloat(prevMotorData.frLoad) + parseFloat(getRandomValue())));
              const flLoadCalc = Math.min(12.9, Math.max(12.1, parseFloat(prevMotorData.flLoad) + parseFloat(getRandomValue())));
              const brLoadCalc = Math.min(13.1, Math.max(11.7, parseFloat(prevMotorData.brLoad) + parseFloat(getRandomValue())));
              const blLoadCalc = Math.min(13.3, Math.max(12.1, parseFloat(prevMotorData.blLoad) + parseFloat(getRandomValue())));

              return {
                  frLoad: frLoadCalc.toFixed(1),
                  flLoad: flLoadCalc.toFixed(1),
                  brLoad: brLoadCalc.toFixed(1),
                  blLoad: blLoadCalc.toFixed(1)
              };
          });

          setJointData(prevJointData => {
              const j0LoadCalc = Math.min(2, Math.max(1, parseFloat(prevJointData.j0Load) + parseFloat(getRandomValue())));
              const j1LoadCalc = Math.min(2, Math.max(1, parseFloat(prevJointData.j1Load) + parseFloat(getRandomValue())));
              const j2LoadCalc = Math.min(2, Math.max(1, parseFloat(prevJointData.j2Load) + parseFloat(getRandomValue())));
              const j3LoadCalc = Math.min(2, Math.max(1, parseFloat(prevJointData.j3Load) + parseFloat(getRandomValue())));
              const j4LoadCalc = Math.min(2, Math.max(1, parseFloat(prevJointData.j4Load) + parseFloat(getRandomValue())));
              const eeLoadCalc = Math.min(7, Math.max(5, parseFloat(prevJointData.eeLoad) + parseFloat(getRandomValue())));

              return {
                  j0Load: j0LoadCalc.toFixed(1),
                  j1Load: j1LoadCalc.toFixed(1),
                  j2Load: j2LoadCalc.toFixed(1),
                  j3Load: j3LoadCalc.toFixed(1),
                  j4Load: j4LoadCalc.toFixed(1),
                  eeLoad: eeLoadCalc.toFixed(1)
              };
          });

          setLabLoadData(prevLabLoadData => {
              const xCalc = Math.min(2.6, Math.max(1.8, parseFloat(prevLabLoadData.x) + parseFloat(getRandomValue())));
              const yCalc = Math.min(2.4, Math.max(1.6, parseFloat(prevLabLoadData.y) + parseFloat(getRandomValue())));
              const zCalc = Math.min(2.2, Math.max(1.4, parseFloat(prevLabLoadData.z) + parseFloat(getRandomValue())));
              const trayCalc = Math.min(4.9, Math.max(3.8, parseFloat(prevLabLoadData.tray) + parseFloat(getRandomValue())));
              const gripperCalc = Math.min(0.8, Math.max(1.2, parseFloat(prevLabLoadData.gripper) + parseFloat(getRandomValue())));

              return {
                  x: xCalc.toFixed(1),
                  y: yCalc.toFixed(1),
                  z: zCalc.toFixed(1),
                  tray: trayCalc.toFixed(1),
                  gripper: gripperCalc.toFixed(1)
              };
          });

      }, 1000);

      return () => clearInterval(interval);
  }, []);


    return (
